function Services() {
  return (
    <div className="container">
      <h1>Our Services</h1>
      <br />
      <div className="service-card">
        <h3>Website & Logo Design</h3>
        <br />
        <p>Professional website and meaningful logo creation.</p>
      </div>
      <div className="service-card">
        <h3>SEO & Lead Generation</h3>
        <br />
        <p>Improve visibility and generate leads.</p>
      </div>{" "}
      <br />
      <button className="btn-primary">Join Now</button>
    </div>
  );
}

export default Services;
